import React from 'react'
import Task from './Task'
import styles from './Tasks.module.css'

function Tasks(props) {
    const { tasks } = props;


    return (
        <div className={styles.tasks}>
            {
                tasks.map((task) => 
                    <Task text={task} />
                )
            }
        </div>
    )
}

export default Tasks
